                                    borderLeft: 'none',
                                    borderRight: 'none',
                                    borderTop: 'none',
                                }}
                            />
                        </div>
                    </div>
                    <button style={{ marginTop: '20px' }} type='submit'>
                        Submit
                    </button>
                </form>
            </div>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '20px' }}>
                {games.map((game) => (
                    <div
                        key={game.id}
                        style={{
                            backgroundColor: '#f0f0f0',
                            padding: '20px',
                            borderRadius: '10px',
                            boxShadow: '0 0 10px rgba(0, 0, 0, 0.2)',
                        }}
                    >
                        <h3>{game.date}</h3>
                        <p>
                            <strong>Team White:</strong> {game.teams.teamWhite.goalie},{' '}
