                            {game.teams.teamWhite.player3}, {game.teams.teamWhite.player4},{' '}
                            {game.teams.teamWhite.player5}, {game.teams.teamWhite.player6}
                        </p>
                        <p>
                            <strong>Team Black:</strong> {game.teams.teamBlack.goalie},{' '}
                            {game.teams.teamBlack.player1}, {game.teams.teamBlack.player2},{' '}
                            {game.teams.teamBlack.player3}, {game.teams.teamBlack.player4},{' '}
                            {game.teams.teamBlack.player5}, {game.teams.teamBlack.player6}
                        </p>
                    </div>
                ))}
            </div>
        </>
    );
};

export default PlayerList;
